import './home.scss'
import Button from '../components/Button';
import { Link } from 'react-router-dom'


export default function Home() {
  return (
    <div className='home'>
      <Link to={'/shop'}>
        <Button variant="danger">shop</Button>
      </Link>
    </div>
    
  );
}
